
DROP DATABASE IF EXISTS target_products_prices;

CREATE DATABASE target_products_prices;

USE target_products_prices;

-- Create tables: categories, products, photos
CREATE TABLE categories (
  Id int NOT NULL, name varchar(50) NOT NULL, Primary KEY (Id)
  );

CREATE TABLE products (
  id int NOT NULL,
  category INT REFERENCES categories(id),
  name varchar(150) NOT NULL,
  price DECIMAL(8,2) NOT NULL,
  Primary KEY (id)
  );

CREATE TABLE photos (
  id int NOT NULL,
  product INT REFERENCES products(id),
  link varchar(400),
  Primary KEY (id)
);

